def five_div_seq(n: int) -> int:
    five_count = 1
    for i in range(n, 0, -1):
        if i % 9 == 0 or i % 14 == 0:
            str_i = str(i)
            if len(str_i) >= 3:
                five_count += str_i.count('5')
    return five_count

